import * as style from "../../css/light/phoneListContainer"

export default function ProfileListItem({data}) {
  const convertData = () => {
    let temp = []
    Object.keys(data).slice(1).forEach((item, i) => {
      temp.push(data[i]['data'])
    })
  
    return temp.splice(1)
  }

  const renderListDataMain = () => {
    return <div style={style.phoneListContainerMAC}>
      {data[0]['data']}
    </div>
  }

  const renderListDataOther = () => {
    return convertData().map((item, i) => (
      <div key={`LData${i}`} style={style.phoneListContainerItem}>{item}</div>
    ))
  }

  return (
    <div>
      <div 
      onMouseEnter={(e) => {
        e.currentTarget.style.border = "2px solid #07405b"
        e.currentTarget.style.height = "18px"
        e.currentTarget.style.width = "calc(65vw - 30px)"
        e.currentTarget.children[0].style.lineHeight = "18px"
      }}
      onMouseLeave={e => {
        e.currentTarget.style.border = ""
        e.currentTarget.style.height = "22px"
        e.currentTarget.style.width = "calc(65vw - 28px)"
      }} 
      style={style.phoneListContainer}>
        {renderListDataMain()}
        <div style={style.phoneListContainerInfo}>
          <div style={style.phoneListContainerItems}>
            {renderListDataOther()}
          </div>
        </div>
      </div>
      <div style={{height: "3px"}}></div>
    </div>
  )
}
